package com.love2shop.springbootshop;

import static org.assertj.core.api.Assertions.assertThat;
import static org.junit.jupiter.api.Assertions.assertEquals;
import static org.junit.jupiter.api.Assertions.assertNotEquals;
import static org.junit.jupiter.api.Assertions.assertNotNull;

import java.util.List;

import org.junit.jupiter.api.MethodOrderer.OrderAnnotation;
import org.junit.jupiter.api.Order;
import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.TestMethodOrder;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.test.context.SpringBootTest;

import com.love2shop.springbootshop.dao.BookRepository;
import com.love2shop.springbootshop.entity.Book;

@SpringBootTest
@TestMethodOrder(OrderAnnotation.class)
class SpringBootShopApplicationTests {

	@Autowired
	BookRepository bookRepository;
	
	
	@Test
	@Order(1)
	 public void testCreate() {
		Book book=new Book();
		book.setId(24L);
		book.setAuthor("Jennifer Davis");
		book.setTitle("Effective Devops");
		book.setDescription("There are many books available on Devops, but this one is different.");
		book.setCopies(15);
		book.setCopiesAvailable(15);
		book.setCategory("DevOps");
		book.setImg("data:image/png;base64,");
		bookRepository.save(book);
		assertNotNull(bookRepository.findById(24L).get());
	}
        
	    @Test
	    @Order(2)
	    public void testReadAll() {
	    	List<Book> list=bookRepository.findAll();
	    	assertThat(list).size().isGreaterThan(0);
	    }
	    
	 
	    @Test
	    @Order(3)
	    public void testSingleBook() {
	    	Book book =bookRepository.findById(1L).get();
	    	assertEquals(10,book.getCopies());
	    }
	    
	    @Test
	    @Order(4)
	    public void testUpdate() {
	    	Book book=bookRepository.findById(2L).get();
	    	book.setCopies(16);
	    	bookRepository.save(book);
	    	assertNotEquals(15,bookRepository.findById(2L).get().getCopies());
	    }
	    
	    @Test
	    @Order(5)
	    public void testDelete() {
	    	bookRepository.deleteById(24L);
	    	assertThat(bookRepository.existsById(24L)).isFalse();
	    }
}